using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UITextFieldDelegate protocol defines the messages sent to a text field delegate as part of the sequence of editing its text. All of the methods of this protocol are optional.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITextFieldDelegate_Protocol/index.html#//apple_ref/occ/intf/UITextFieldDelegate"/>    [iOSVersion(2)]    public interface UITextFieldDelegate//: NSObjectProtocol    {        /// <summary>        /// Asks the delegate if editing should begin in the specified text field.        /// </summary>        /// <param name="textField">The text field for which editing is about to begin.</param>        [iOSVersion(2)]        [Export("textFieldShouldBeginEditing")]        bool TextFieldShouldBeginEditing(UITextField textField);                /// <summary>        /// Tells the delegate that editing began for the specified text field.        /// </summary>        /// <param name="textField">The text field for which an editing session began.</param>        [iOSVersion(2)]        [Export("textFieldDidBeginEditing")]        void TextFieldDidBeginEditing(UITextField textField);                /// <summary>        /// Asks the delegate if editing should stop in the specified text field.        /// </summary>        /// <param name="textField">The text field for which editing is about to end.</param>        [iOSVersion(2)]        [Export("textFieldShouldEndEditing")]        bool TextFieldShouldEndEditing(UITextField textField);                /// <summary>        /// Tells the delegate that editing stopped for the specified text field.        /// </summary>        /// <param name="textField">The text field for which editing ended.</param>        [iOSVersion(2)]        [Export("textFieldDidEndEditing")]        void TextFieldDidEndEditing(UITextField textField);                /// <summary>        /// Asks the delegate if the specified text should be changed.        /// </summary>        /// <param name="textField">The text field containing the text.</param>        /// <param name="shouldChangeCharactersInRange">The range of characters to be replaced</param>        /// <param name="replacementString">The replacement string.</param>        [iOSVersion(2)]        [Export("textField")]        bool TextField(UITextField textField, NSRange shouldChangeCharactersInRange, string replacementString);                /// <summary>        /// Asks the delegate if the text fieldâ€™s current contents should be removed.        /// </summary>        /// <param name="textField">The text field containing the text.</param>        [iOSVersion(2)]        [Export("textFieldShouldClear")]        bool TextFieldShouldClear(UITextField textField);                /// <summary>        /// Asks the delegate if the text field should process the pressing of the return button.        /// </summary>        /// <param name="textField">The text field whose return button was pressed.</param>        [iOSVersion(2)]        [Export("textFieldShouldReturn")]        bool TextFieldShouldReturn(UITextField textField);    }}